import React, {useState} from 'react';
import {View, Text, Button, TextInput} from 'react-native'

export default function Profile(props) {


    const [outputText, setOutputText] = useState("");
    const [submittedText, setSubmittedText] = useState('');


    function itemInputHandler(enteredText) {
        setOutputText(enteredText);
    }

    function addItemHandler() {
        setSubmittedText(outputText);
        setOutputText('');
    }

    return (
        <View>
            <Text>Username: {submittedText}</Text>
            <TextInput onChangeText={itemInputHandler} value={outputText}/>

            <Button title="Change" onPress={addItemHandler}></Button>


            <Button title="Go to Home" onPress={() => props.navigation.navigate("Home", {
            icon: "",
            username: {submittedText},
            astroSign: ""
            })}> </Button>
        </View>
    )
}

